graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Parallel Processing</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "source" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>source</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Data source</td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "processA" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>processA</b> <i>&lt;task&gt;</i> <i>@Async</i></td></tr><tr><td align="left">Process A</td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "processB" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>processB</b> <i>&lt;task&gt;</i> <i>@Async</i></td></tr><tr><td align="left">Process B</td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "processC" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>processC</b> <i>&lt;task&gt;</i> <i>@Async</i></td></tr><tr><td align="left">Process C</td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
  "aggregate" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>aggregate</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Aggregate results</td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];

  // Edges
  "source" -> "processA" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "source" -> "processB" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "source" -> "processC" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "processA" -> "aggregate" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "processB" -> "aggregate" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "processC" -> "aggregate" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
